pragma solidity ^0.5.8;

contract Walletless {

    uint number;            // registered users number

    struct User {
        address primary;
        address temporary;
        string ID;
    }

    address gameOwner = msg.sender;

    uint public nonce;                          // mutable state
    uint public threshold;                      // immutable state
    mapping (address => uint) public temporaryAddresses; // mutable state
    mapping (address => uint) public primaryAddresses; // mutable state
    mapping (string => uint) ids;           // Email to User ID
    mapping (uint => User) public users;               // User ID to User data

    // EIP712 Precomputed hashes:
    // keccak256("EIP712Domain(string name,string version,uint256 chainId,address verifyingContract,bytes32 salt)")
    bytes32 constant EIP712DOMAINTYPE_HASH = 0xd87cd6ef79d4e2b95e15ce8abf732db51ec771f1ca2edccf22a46c729ac56472;

    // keccak256("Register temporary account")
    bytes32 constant NAME_HASH_TEMPORARY = 0xb09ecc80b914533a87b3030e2f4a181b6d84f8bd6302c1461fc359411592a774;

    // keccak256("1")
    bytes32 constant VERSION_HASH_TEMPORARY = 0xc89efdaa54c0f20c7adf612882df0950f5a951637e0307cdcb4c672f298b8bc6;

    // keccak256("UpdateTemporary(address account,string memory id,uint256 nonce)")
    bytes32 constant TXTYPE_HASH_TEMPORARY = 0x626fa3909ffec8617c25e36eb89d32ac3e7acd5bf7238d2c5f269cceed4f2ed1;

    bytes32 DOMAIN_SEPARATOR_TEMPORARY;          // hash for EIP712, computed from contract address


    // keccak256("Register primary account")
    bytes32 constant NAME_HASH_PRIMARY = 0x01d766ba82427b4e83818bd3a2047efa2184e836a10a9c6dbf489a6b2c81949f;

    // keccak256("1")
    bytes32 constant VERSION_HASH_PRIMARY = 0xc89efdaa54c0f20c7adf612882df0950f5a951637e0307cdcb4c672f298b8bc6;

    // keccak256("UpdatePrimary(address temporary,address primary,string memory id,uint256 nonce)")
    bytes32 constant TXTYPE_HASH_PRIMARY = 0x4752ecfe97551d5427f851c2a20e8a798903d642e73f36cb34ecc076eb43470c;

    bytes32 DOMAIN_SEPARATOR_PRIMARY;          // hash for EIP712, computed from contract address


    // keccak256("by Medet Ahmetson")
    bytes32 constant SALT = 0xfbbbedd42a3ca2dc0ec761a1d7ca7eaea72b97aa3f7c46c3a7cd20be0ae6c8dc;


    // Note that owners_ must be strictly increasing, in order to prevent duplicates
    constructor(uint chainId) public {
        threshold = 2;
        number = 0;

        DOMAIN_SEPARATOR_TEMPORARY = keccak256(abi.encode(EIP712DOMAINTYPE_HASH,
                                                NAME_HASH_TEMPORARY,
                                                VERSION_HASH_TEMPORARY,
                                                chainId,
                                                this,
                                                SALT));

        DOMAIN_SEPARATOR_TEMPORARY = keccak256(abi.encode(EIP712DOMAINTYPE_HASH,
                                                NAME_HASH_PRIMARY,
                                                VERSION_HASH_PRIMARY,
                                                chainId,
                                                this,
                                                SALT));
    }


    /// Add a temporary address to the account
    function UpdateTemporary(address account, string memory id, uint8[] memory sigV, bytes32[] memory sigR, bytes32[] memory sigS) public {
        require(sigR.length == threshold);
        require(sigR.length == sigS.length && sigR.length == sigV.length);
        require(account != gameOwner, "Game Owner can't update temporary account");
        require(temporaryAddresses[account] == 0, "Address is used as a temporary account");
        require(primaryAddresses[account] == 0, "Address is used as a primary account");
        require(bytes(id).length <= 254, "ID length must not exceed 254 characters");

        // Method should be called by one of the Multisig accounts
        require (account == msg.sender || gameOwner == msg.sender, "Permission denied");


        // EIP712 scheme: https://github.com/ethereum/EIPs/blob/master/EIPS/eip-712.md
        bytes32 txInputHash = keccak256(abi.encode(TXTYPE_HASH_TEMPORARY, account, id, nonce));
        bytes32 totalHash = keccak256(abi.encodePacked("\x19\x01", DOMAIN_SEPARATOR_TEMPORARY, txInputHash));

        // First signer is a temporary account
        address recovered_0 = ecrecover(totalHash, sigV[0], sigR[0], sigS[0]);
        require(recovered_0 == account, "First signer is not a temporary account owner");
        // Second signer is Game owner
        address recovered_1 = ecrecover(totalHash, sigV[1], sigR[1], sigS[1]);
        require(recovered_1 == gameOwner, "Second signer is not a game owner");


        // if id exists,
        // remove the temporary account
        // update the user's temporary account
        uint userNumber = ids[id];
        if (userNumber > 0) {
            User storage user = users[userNumber];

            address oldTemporary = user.temporary;
            if (temporaryAddresses[oldTemporary] > 0) {
                delete temporaryAddresses[oldTemporary];
            }

            user.temporary = account;
        }
        else {
            number = number + 1;
            userNumber = number;

            users[number] = User(account, address(0), id);
        }

        // register the temporary account
        temporaryAddresses[account] = number;

        // If we make it here all signatures are accounted for.
        // The address.call() syntax is no longer recommended, see:
        // https://github.com/ethereum/solidity/issues/2884
        nonce = nonce + 1;
    }


    // Add a primary wallet address (account) of a user.
    // This operation is valid once only. After adding primary address, player can not change it later
    // So in future version we could change that
    //
    // requirements to update the primary address is to have an temporary address with ID
    function UpdatePrimary(address executor_, address primary_, uint8[] memory sigV, bytes32[] memory sigR, bytes32[] memory sigS) public {
        require(temporaryAddresses[executor_] > 0, "Temporary address not exists");
        require(temporaryAddresses[primary_] == 0, "Address is already used as a temporary account");
        require(primaryAddresses[primary_] == 0, "Address is already used as a primary account");

        require(sigR.length == threshold);
        require(sigR.length == sigS.length && sigR.length == sigV.length);
        require(executor_ != gameOwner, "Game Owner can't update temporary account");
        require(primary_ != gameOwner, "Game Owner can't join the game");

        // Method should be called by one of the Multisig accounts
        require (executor_ == msg.sender || gameOwner == msg.sender, "Permission denied");

        // if id exists,
        // remove the temporary account
        // update the user's temporary account
        uint userNumber = temporaryAddresses[executor_];

        require(users[userNumber].primary == address(0), "Primary address exists for the user");


        // EIP712 scheme: https://github.com/ethereum/EIPs/blob/master/EIPS/eip-712.md
        bytes32 txInputHash = keccak256(abi.encode(TXTYPE_HASH_PRIMARY, executor_, primary_, users[userNumber].ID, nonce));
        bytes32 totalHash = keccak256(abi.encodePacked("\x19\x01", DOMAIN_SEPARATOR_PRIMARY, txInputHash));

        // First signer is a temporary account
        address recovered_0 = ecrecover(totalHash, sigV[0], sigR[0], sigS[0]);
        require(recovered_0 == executor_, "First signer is not a temporary account owner");
        // Second signer is Game owner
        address recovered_1 = ecrecover(totalHash, sigV[1], sigR[1], sigS[1]);
        require(recovered_1 == gameOwner, "Second signer is not a game owner");


        users[userNumber].primary = primary_;

        // register the primary account
        primaryAddresses[primary_] = userNumber;

        // If we make it here all signatures are accounted for.
        // The address.call() syntax is no longer recommended, see:
        // https://github.com/ethereum/solidity/issues/2884
        nonce = nonce + 1;
    }


    // Can update the ID if primary address is added.
    // Only primary address hold can invoke the function
    function UpdateID(string memory id_) public {
        require(primaryAddresses[msg.sender] > 0, "Player do not exists");
        require(ids[id_] == 0, "ID is already used by some User");
        require(bytes(id_).length <= 254, "ID length must not exceed 254 characters");

        uint userNumber = primaryAddresses[msg.sender];

        // remove the previous id
        delete ids[users[userNumber].ID];

        users[userNumber].ID = id_;
    }

    /// Returns User.ID by temporary or primary account used by the player
    function GetID(address account) public view returns(string memory) {
        uint userNumber = primaryAddresses[account];
        if (userNumber == 0) {
            userNumber = temporaryAddresses[account];

            if (userNumber == 0) {
                return "";
            }
        }

        return users[userNumber].ID;
    }

    function GetTemporary(string memory id_) public view returns (address) {
        uint userNumber = ids[id_];
        if (userNumber == 0) {
            return address(0);
        }
        return users[userNumber].temporary;
    }

    function GetPrimary(string memory id_) public view returns (address) {
        uint userNumber = ids[id_];
        if (userNumber == 0) {
            return address(0);
        }
        return users[userNumber].primary;
    }
}
